package com.topcoder.service.studio.ejb;

import javax.xml.bind.annotation.XmlAccessType;
import javax.xml.bind.annotation.XmlAccessorType;
import javax.xml.bind.annotation.XmlElement;
import javax.xml.bind.annotation.XmlRootElement;
import javax.xml.bind.annotation.XmlType;

/**
 * <p>
 * This class represents the "project_not_found_fault" element in WSDL. It's
 * contained in the related exception-message class, it's the fault bean. It was
 * generated by JBoss tools and I changed the name and other little changes.
 * </p>
 *
 * <p>
 * This class is not thread safe because it's highly mutable
 * </p>
 *
 * @author fabrizyo, TCSDEVELOPER
 * @version 1.0
 */
@XmlAccessorType(XmlAccessType.FIELD)
@XmlType(name = "", propOrder = { "projectIdNotFound" })
@XmlRootElement(name = "project_not_found_fault")
public class ProjectNotFoundFault {
    /**
     * <p>
     * Represents the project Not Found in the exception. I updated the WSDL,
     * now it's long.
     * </p>
     */
    @XmlElement(name = "project_not_found", required = true)
    private long projectIdNotFound;

    /**
     * <p>
     * This is the default constructor. It does nothing.
     * </p>
     */
    public ProjectNotFoundFault() {
    }

    /**
     * <p>
     * Gets the value of the projectIdNotFound property.
     * </p>
     *
     * @return the value of the projectIdNotFound property.
     */
    public long getProjectIdNotFound() {
        return projectIdNotFound;
    }

    /**
     * <p>
     * Sets the value of the projectIdNotFound property.
     * </p>
     *
     * @param projectIdNotFound the value to set
     */
    public void setProjectIdNotFound(long projectIdNotFound) {
        this.projectIdNotFound = projectIdNotFound;
    }
}
